demo.repl.help:
Dostupné příkazy:
  @show              ─ zobrazí poslední souhrn adaptivní karty
  @json              ─ vypíše nezpracovanou hodnotu JSON přijatou z toku
  @back              ─ vrátí se k předchozí blokované kartě/vstupům
  @input <k>=<v>     ─ nastaví nebo přepíše vstupní pole
  @click <action_id> ─ odešle kartu se zadanou akcí
  @help              ─ vypíše tento text nápovědy
  @quit              ─ ukončí REPL
